import './App.css';

function App() {
  return (

    <div className="App">
      <label>Title</label><br></br>
      <input type="text"/>

      <label>Author</label>
      <input type="text"/>

      <label>Year</label>
      <input type="number"/>

      <label>Image</label>
      <input type="text"/>
    </div>
  );
}

export default App;
